INSERT INTO `dim_productlines` (`id`, `productLine`, `textDescription`, `htmlDescription`, `image`) VALUES
(1, 'Classic Cars', 'Attention car enthusiasts: Make your wildest car ownership dreams come true. Whether you are looking for classic muscle cars, dream sports cars or movie-inspired miniatures, you will find great choices in this category. These replicas feature superb attention to detail and craftsmanship and offer features such as working steering system, opening forward compartment, opening rear trunk with removable spare wheel, 4-wheel independent spring suspension, and so on. The models range in size from 1:10 to 1:24 scale and include numerous limited edition and several out-of-production vehicles. All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.', '', ''),
(2, 'Motorcycles', 'Our motorcycles are state of the art replicas of classic as well as contemporary motorcycle legends such as Harley Davidson, Ducati and Vespa. Models contain stunning details such as official logos, rotating wheels, working kickstand, front suspension, gear-shift lever, footbrake lever, and drive chain. Materials used include diecast and plastic. The models range in size from 1:10 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. All models come fully assembled and ready for display in the home or office. Most include a certificate of authenticity.', '', ''),
(3, 'Planes', 'Unique, diecast airplane and helicopter replicas suitable for collections, as well as home, office or classroom decorations. Models contain stunning details such as official logos and insignias, rotating jet engines and propellers, retractable wheels, and so on. Most come fully assembled and with a certificate of authenticity from their manufacturers.', '', ''),
(4, 'Ships', 'The perfect holiday or anniversary gift for executives, clients, friends, and family. These handcrafted model ships are unique, stunning works of art that will be treasured for generations! They come fully assembled and ready for display in the home or office. We guarantee the highest quality, and best value.', '', ''),
(5, 'Trains', 'Model trains are a rewarding hobby for enthusiasts of all ages. Whether you\'re looking for collectible wooden trains, electric streetcars or locomotives, you\'ll find a number of great choices for any budget within this category. The interactive aspect of trains makes toy trains perfect for young children. The wooden train sets are ideal for children under the age of 5.', '', ''),
(6, 'Trucks and Buses', 'The Truck and Bus models are realistic replicas of buses and specialized trucks produced from the early 1920s to present. The models range in size from 1:12 to 1:50 scale and include numerous limited edition and several out-of-production vehicles. Materials used include tin, diecast and plastic. All models include a certificate of authenticity from their manufacturers and are a perfect ornament for the home and office.', '', ''),
(7, 'Vintage Cars', 'Our Vintage Car models realistically portray automobiles produced from the early 1900s through the 1940s. Materials used include Bakelite, diecast, plastic and wood. Most of the replicas are in the 1:18 and 1:24 scale sizes, which provide the optimum in detail and accuracy. Prices range from $30.00 up to $180.00 for some special limited edition replicas. All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.', '', '');
INSERT INTO `dim_products` (`id`, `productCode`, `productName`, `productLine`, `productDescription`) VALUES
(1, 'S10_1678', '1969 Harley Davidson Ultimate Chopper', 'Motorcycles', 'This replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. All parts are particularly delicate due to their precise scale and require special care and attention.'),
(2, 'S10_1949', '1952 Alpine Renault 1300', 'Classic Cars', 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(3, 'S10_2016', '1996 Moto Guzzi 1100i', 'Motorcycles', 'Official Moto Guzzi logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.'),
(4, 'S10_4698', '2003 Harley-Davidson Eagle Drag Bike', 'Motorcycles', 'Model features, official Harley Davidson logos and insignias, detachable rear wheelie bar, heavy diecast metal with resin parts, authentic multi-color tampo-printed graphics, separate engine drive belts, free-turning front fork, rotating tires and rear racing slick, certificate of authenticity, detailed engine, display stand\r\n, precision diecast replica, baked enamel finish, 1:10 scale model, removable fender, seat and tank cover piece for displaying the superior detail of the v-twin engine'),
(5, 'S10_4757', '1972 Alfa Romeo GTA', 'Classic Cars', 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(6, 'S10_4962', '1962 LanciaA Delta 16V', 'Classic Cars', 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(7, 'S12_1099', '1968 Ford Mustang', 'Classic Cars', 'Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color dark green.'),
(8, 'S12_1108', '2001 Ferrari Enzo', 'Classic Cars', 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(9, 'S12_1666', '1958 Setra Bus', 'Trucks and Buses', 'Model features 30 windows, skylights & glare resistant glass, working steering system, original logos'),
(10, 'S12_2823', '2002 Suzuki XREO', 'Motorcycles', 'Official logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.'),
(11, 'S12_3148', '1969 Corvair Monza', 'Classic Cars', '1:18 scale die-cast about 10\" long doors open, hood opens, trunk opens and wheels roll'),
(12, 'S12_3380', '1968 Dodge Charger', 'Classic Cars', '1:12 scale model of a 1968 Dodge Charger. Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color black'),
(13, 'S12_3891', '1969 Ford Falcon', 'Classic Cars', 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(14, 'S12_3990', '1970 Plymouth Hemi Cuda', 'Classic Cars', 'Very detailed 1970 Plymouth Cuda model in 1:12 scale. The Cuda is generally accepted as one of the fastest original muscle cars from the 1970s. This model is a reproduction of one of the orginal 652 cars built in 1970. Red color.'),
(15, 'S12_4473', '1957 Chevy Pickup', 'Trucks and Buses', '1:12 scale die-cast about 20\" long Hood opens, Rubber wheels'),
(16, 'S12_4675', '1969 Dodge Charger', 'Classic Cars', 'Detailed model of the 1969 Dodge Charger. This model includes finely detailed interior and exterior features. Painted in red and white.'),
(17, 'S18_1097', '1940 Ford Pickup Truck', 'Trucks and Buses', 'This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood,  removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box'),
(18, 'S18_1129', '1993 Mazda RX-7', 'Classic Cars', 'This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color red.'),
(19, 'S18_1342', '1937 Lincoln Berline', 'Vintage Cars', 'Features opening engine cover, doors, trunk, and fuel filler cap. Color black'),
(20, 'S18_1367', '1936 Mercedes-Benz 500K Special Roadster', 'Vintage Cars', 'This 1:18 scale replica is constructed of heavy die-cast metal and has all the features of the original: working doors and rumble seat, independent spring suspension, detailed interior, working steering system, and a bifold hood that reveals an engine so accurate that it even includes the wiring. All this is topped off with a baked enamel finish. Color white.'),
(21, 'S18_1589', '1965 Aston Martin DB5', 'Classic Cars', 'Die-cast model of the silver 1965 Aston Martin DB5 in silver. This model includes full wire wheels and doors that open with fully detailed passenger compartment. In 1:18 scale, this model measures approximately 10 inches/20 cm long.'),
(22, 'S18_1662', '1980s Black Hawk Helicopter', 'Planes', '1:18 scale replica of actual Army\'s UH-60L BLACK HAWK Helicopter. 100% hand-assembled. Features rotating rotor blades, propeller blades and rubber wheels.'),
(23, 'S18_1749', '1917 Grand Touring Sedan', 'Vintage Cars', 'This 1:18 scale replica of the 1917 Grand Touring car has all the features you would expect from museum quality reproductions: all four doors and bi-fold hood opening, detailed engine and instrument panel, chrome-look trim, and tufted upholstery, all topped off with a factory baked-enamel finish.'),
(24, 'S18_1889', '1948 Porsche 356-A Roadster', 'Classic Cars', 'This precision die-cast replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(25, 'S18_1984', '1995 Honda Civic', 'Classic Cars', 'This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color yellow.'),
(26, 'S18_2238', '1998 Chrysler Plymouth Prowler', 'Classic Cars', 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(27, 'S18_2248', '1911 Ford Town Car', 'Vintage Cars', 'Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system.'),
(28, 'S18_2319', '1964 Mercedes Tour Bus', 'Trucks and Buses', 'Exact replica. 100+ parts. working steering system, original logos'),
(29, 'S18_2325', '1932 Model A Ford J-Coupe', 'Vintage Cars', 'This model features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine'),
(30, 'S18_2432', '1926 Ford Fire Engine', 'Trucks and Buses', 'Gleaming red handsome appearance. Everything is here the fire hoses, ladder, axes, bells, lanterns, ready to fight any inferno.'),
(31, 'S18_2581', 'P-51-D Mustang', 'Planes', 'Has retractable wheels and comes with a stand'),
(32, 'S18_2625', '1936 Harley Davidson El Knucklehead', 'Motorcycles', 'Intricately detailed with chrome accents and trim, official die-struck logos and baked enamel finish.'),
(33, 'S18_2795', '1928 Mercedes-Benz SSK', 'Vintage Cars', 'This 1:18 replica features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine. Color black.'),
(34, 'S18_2870', '1999 Indy 500 Monte Carlo SS', 'Classic Cars', 'Features include opening and closing doors. Color: Red'),
(35, 'S18_2949', '1913 Ford Model T Speedster', 'Vintage Cars', 'This 250 part reproduction includes moving handbrakes, clutch, throttle and foot pedals, squeezable horn, detailed wired engine, removable water, gas, and oil cans, pivoting monocle windshield, all topped with a baked enamel red finish. Each replica comes with an Owners Title and Certificate of Authenticity. Color red.'),
(36, 'S18_2957', '1934 Ford V8 Coupe', 'Vintage Cars', 'Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System'),
(37, 'S18_3029', '1999 Yamaha Speed Boat', 'Ships', 'Exact replica. Wood and Metal. Many extras including rigging, long boats, pilot house, anchors, etc. Comes with three masts, all square-rigged.'),
(38, 'S18_3136', '18th Century Vintage Horse Carriage', 'Vintage Cars', 'Hand crafted diecast-like metal horse carriage is re-created in about 1:18 scale of antique horse carriage. This antique style metal Stagecoach is all hand-assembled with many different parts.\r\n\r\nThis collectible metal horse carriage is painted in classic Red, and features turning steering wheel and is entirely hand-finished.'),
(39, 'S18_3140', '1903 Ford Model A', 'Vintage Cars', 'Features opening trunk,  working steering system'),
(40, 'S18_3232', '1992 Ferrari 360 Spider red', 'Classic Cars', 'his replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(41, 'S18_3233', '1985 Toyota Supra', 'Classic Cars', 'This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood, removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box'),
(42, 'S18_3259', 'Collectable Wooden Train', 'Trains', 'Hand crafted wooden toy train set is in about 1:18 scale, 25 inches in total length including 2 additional carts, of actual vintage train. This antique style wooden toy train model set is all hand-assembled with 100% wood.'),
(43, 'S18_3278', '1969 Dodge Super Bee', 'Classic Cars', 'This replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(44, 'S18_3320', '1917 Maxwell Touring Car', 'Vintage Cars', 'Features Gold Trim, Full Size Spare Tire, Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System'),
(45, 'S18_3482', '1976 Ford Gran Torino', 'Classic Cars', 'Highly detailed 1976 Ford Gran Torino \"Starsky and Hutch\" diecast model. Very well constructed and painted in red and white patterns.'),
(46, 'S18_3685', '1948 Porsche Type 356 Roadster', 'Classic Cars', 'This model features working front and rear suspension on accurately replicated and actuating shock absorbers as well as opening engine cover, rear stabilizer flap,  and 4 opening doors.'),
(47, 'S18_3782', '1957 Vespa GS150', 'Motorcycles', 'Features rotating wheels , working kick stand. Comes with stand.'),
(48, 'S18_3856', '1941 Chevrolet Special Deluxe Cabriolet', 'Vintage Cars', 'Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system, leather upholstery. Color black.'),
(49, 'S18_4027', '1970 Triumph Spitfire', 'Classic Cars', 'Features include opening and closing doors. Color: White.'),
(50, 'S18_4409', '1932 Alfa Romeo 8C2300 Spider Sport', 'Vintage Cars', 'This 1:18 scale precision die cast replica features the 6 front headlights of the original, plus a detailed version of the 142 horsepower straight 8 engine, dual spares and their famous comprehensive dashboard. Color black.'),
(51, 'S18_4522', '1904 Buick Runabout', 'Vintage Cars', 'Features opening trunk,  working steering system'),
(52, 'S18_4600', '1940s Ford truck', 'Trucks and Buses', 'This 1940s Ford Pick-Up truck is re-created in 1:18 scale of original 1940s Ford truck. This antique style metal 1940s Ford Flatbed truck is all hand-assembled. This collectible 1940\'s Pick-Up truck is painted in classic dark green color, and features rotating wheels.'),
(53, 'S18_4668', '1939 Cadillac Limousine', 'Vintage Cars', 'Features completely detailed interior including Velvet flocked drapes,deluxe wood grain floor, and a wood grain casket with seperate chrome handles'),
(54, 'S18_4721', '1957 Corvette Convertible', 'Classic Cars', '1957 die cast Corvette Convertible in Roman Red with white sides and whitewall tires. 1:18 scale quality die-cast with detailed engine and underbvody. Now you can own The Classic Corvette.'),
(55, 'S18_4933', '1957 Ford Thunderbird', 'Classic Cars', 'This 1:18 scale precision die-cast replica, with its optional porthole hardtop and factory baked-enamel Thunderbird Bronze finish, is a 100% accurate rendition of this American classic.'),
(56, 'S24_1046', '1970 Chevy Chevelle SS 454', 'Classic Cars', 'This model features rotating wheels, working streering system and opening doors. All parts are particularly delicate due to their precise scale and require special care and attention. It should not be picked up by the doors, roof, hood or trunk.'),
(57, 'S24_1444', '1970 Dodge Coronet', 'Classic Cars', '1:24 scale die-cast about 18\" long doors open, hood opens and rubber wheels'),
(58, 'S24_1578', '1997 BMW R 1100 S', 'Motorcycles', 'Detailed scale replica with working suspension and constructed from over 70 parts'),
(59, 'S24_1628', '1966 Shelby Cobra 427 S/C', 'Classic Cars', 'This diecast model of the 1966 Shelby Cobra 427 S/C includes many authentic details and operating parts. The 1:24 scale model of this iconic lighweight sports car from the 1960s comes in silver and it\'s own display case.'),
(60, 'S24_1785', '1928 British Royal Navy Airplane', 'Planes', 'Official logos and insignias'),
(61, 'S24_1937', '1939 Chevrolet Deluxe Coupe', 'Vintage Cars', 'This 1:24 scale die-cast replica of the 1939 Chevrolet Deluxe Coupe has the same classy look as the original. Features opening trunk, hood and doors and a showroom quality baked enamel finish.'),
(62, 'S24_2000', '1960 BSA Gold Star DBD34', 'Motorcycles', 'Detailed scale replica with working suspension and constructed from over 70 parts'),
(63, 'S24_2011', '18th century schooner', 'Ships', 'All wood with canvas sails. Many extras including rigging, long boats, pilot house, anchors, etc. Comes with 4 masts, all square-rigged.'),
(64, 'S24_2022', '1938 Cadillac V-16 Presidential Limousine', 'Vintage Cars', 'This 1:24 scale precision die cast replica of the 1938 Cadillac V-16 Presidential Limousine has all the details of the original, from the flags on the front to an opening back seat compartment complete with telephone and rifle. Features factory baked-enamel black finish, hood goddess ornament, working jump seats.'),
(65, 'S24_2300', '1962 Volkswagen Microbus', 'Trucks and Buses', 'This 1:18 scale die cast replica of the 1962 Microbus is loaded with features: A working steering system, opening front doors and tailgate, and famous two-tone factory baked enamel finish, are all topped of by the sliding, real fabric, sunroof.'),
(66, 'S24_2360', '1982 Ducati 900 Monster', 'Motorcycles', 'Features two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand'),
(67, 'S24_2766', '1949 Jaguar XK 120', 'Classic Cars', 'Precision-engineered from original Jaguar specification in perfect scale ratio. Features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(68, 'S24_2840', '1958 Chevy Corvette Limited Edition', 'Classic Cars', 'The operating parts of this 1958 Chevy Corvette Limited Edition are particularly delicate due to their precise scale and require special care and attention. Features rotating wheels, working streering, opening doors and trunk. Color dark green.'),
(69, 'S24_2841', '1900s Vintage Bi-Plane', 'Planes', 'Hand crafted diecast-like metal bi-plane is re-created in about 1:24 scale of antique pioneer airplane. All hand-assembled with many different parts. Hand-painted in classic yellow and features correct markings of original airplane.'),
(70, 'S24_2887', '1952 Citroen-15CV', 'Classic Cars', 'Precision crafted hand-assembled 1:18 scale reproduction of the 1952 15CV, with its independent spring suspension, working steering system, opening doors and hood, detailed engine and instrument panel, all topped of with a factory fresh baked enamel finish.'),
(71, 'S24_2972', '1982 Lamborghini Diablo', 'Classic Cars', 'This replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(72, 'S24_3151', '1912 Ford Model T Delivery Wagon', 'Vintage Cars', 'This model features chrome trim and grille, opening hood, opening doors, opening trunk, detailed engine, working steering system. Color white.'),
(73, 'S24_3191', '1969 Chevrolet Camaro Z28', 'Classic Cars', '1969 Z/28 Chevy Camaro 1:24 scale replica. The operating parts of this limited edition 1:24 scale diecast model car 1969 Chevy Camaro Z28- hood, trunk, wheels, streering, suspension and doors- are particularly delicate due to their precise scale and require special care and attention.'),
(74, 'S24_3371', '1971 Alpine Renault 1600s', 'Classic Cars', 'This 1971 Alpine Renault 1600s replica Features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(75, 'S24_3420', '1937 Horch 930V Limousine', 'Vintage Cars', 'Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system'),
(76, 'S24_3432', '2002 Chevy Corvette', 'Classic Cars', 'The operating parts of this limited edition Diecast 2002 Chevy Corvette 50th Anniversary Pace car Limited Edition are particularly delicate due to their precise scale and require special care and attention. Features rotating wheels, poseable streering, opening doors and trunk.'),
(77, 'S24_3816', '1940 Ford Delivery Sedan', 'Vintage Cars', 'Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System. Color black.'),
(78, 'S24_3856', '1956 Porsche 356A Coupe', 'Classic Cars', 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
(79, 'S24_3949', 'Corsair F4U ( Bird Cage)', 'Planes', 'Has retractable wheels and comes with a stand. Official logos and insignias.'),
(80, 'S24_3969', '1936 Mercedes Benz 500k Roadster', 'Vintage Cars', 'This model features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system and rubber wheels. Color black.'),
(81, 'S24_4048', '1992 Porsche Cayenne Turbo Silver', 'Classic Cars', 'This replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
(82, 'S24_4258', '1936 Chrysler Airflow', 'Vintage Cars', 'Features opening trunk,  working steering system. Color dark green.'),
(83, 'S24_4278', '1900s Vintage Tri-Plane', 'Planes', 'Hand crafted diecast-like metal Triplane is Re-created in about 1:24 scale of antique pioneer airplane. This antique style metal triplane is all hand-assembled with many different parts.'),
(84, 'S24_4620', '1961 Chevrolet Impala', 'Classic Cars', 'This 1:18 scale precision die-cast reproduction of the 1961 Chevrolet Impala has all the features-doors, hood and trunk that open; detailed 409 cubic-inch engine; chrome dashboard and stick shift, two-tone interior; working steering system; all topped of with a factory baked-enamel finish.'),
(85, 'S32_1268', '1980s GM Manhattan Express', 'Trucks and Buses', 'This 1980s era new look Manhattan express is still active, running from the Bronx to mid-town Manhattan. Has 35 opeining windows and working lights. Needs a battery.'),
(86, 'S32_1374', '1997 BMW F650 ST', 'Motorcycles', 'Features official die-struck logos and baked enamel finish. Comes with stand.'),
(87, 'S32_2206', '1982 Ducati 996 R', 'Motorcycles', 'Features rotating wheels , working kick stand. Comes with stand.'),
(88, 'S32_2509', '1954 Greyhound Scenicruiser', 'Trucks and Buses', 'Model features bi-level seating, 50 windows, skylights & glare resistant glass, working steering system, original logos'),
(89, 'S32_3207', '1950\'s Chicago Surface Lines Streetcar', 'Trains', 'This streetcar is a joy to see. It has 80 separate windows, electric wire guides, detailed interiors with seats, poles and drivers controls, rolling and turning wheel assemblies, plus authentic factory baked-enamel finishes (Green Hornet for Chicago and Cream and Crimson for Boston).'),
(90, 'S32_3522', '1996 Peterbilt 379 Stake Bed with Outrigger', 'Trucks and Buses', 'This model features, opening doors, detailed engine, working steering, tinted windows, detailed interior, die-struck logos, removable stakes operating outriggers, detachable second trailer, functioning 360-degree self loader, precision molded resin trailer and trim, baked enamel finish on cab'),
(91, 'S32_4289', '1928 Ford Phaeton Deluxe', 'Vintage Cars', 'This model features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system'),
(92, 'S32_4485', '1974 Ducati 350 Mk3 Desmo', 'Motorcycles', 'This model features two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand'),
(93, 'S50_1341', '1930 Buick Marquette Phaeton', 'Vintage Cars', 'Features opening trunk,  working steering system'),
(94, 'S50_1392', 'Diamond T620 Semi-Skirted Tanker', 'Trucks and Buses', 'This limited edition model is licensed and perfectly scaled for Lionel Trains. The Diamond T620 has been produced in solid precision diecast and painted with a fire baked enamel finish. It comes with a removable tanker and is a perfect model to add authenticity to your static train or car layout or to just have on display.'),
(95, 'S50_1514', '1962 City of Detroit Streetcar', 'Trains', 'This streetcar is a joy to see. It has 99 separate windows, electric wire guides, detailed interiors with seats, poles and drivers controls, rolling and turning wheel assemblies, plus authentic factory baked-enamel finishes (Green Hornet for Chicago and Cream and Crimson for Boston).'),
(96, 'S50_4713', '2002 Yamaha YZR M1', 'Motorcycles', 'Features rotating wheels , working kick stand. Comes with stand.'),
(97, 'S700_1138', 'The Schooner Bluenose', 'Ships', 'All wood with canvas sails. Measures 31 1/2 inches in Length, 22 inches High and 4 3/4 inches Wide. Many extras.\r\nThe schooner Bluenose was built in Nova Scotia in 1921 to fish the rough waters off the coast of Newfoundland. Because of the Bluenose racing prowess she became the pride of all Canadians. Still featured on stamps and the Canadian dime, the Bluenose was lost off Haiti in 1946.'),
(98, 'S700_1691', 'American Airlines: B767-300', 'Planes', 'Exact replia with official logos and insignias and retractable wheels'),
(99, 'S700_1938', 'The Mayflower', 'Ships', 'Measures 31 1/2 inches Long x 25 1/2 inches High x 10 5/8 inches Wide\r\nAll wood with canvas sail. Extras include long boats, rigging, ladders, railing, anchors, side cannons, hand painted, etc.'),
(100, 'S700_2047', 'HMS Bounty', 'Ships', 'Measures 30 inches Long x 27 1/2 inches High x 4 3/4 inches Wide. \r\nMany extras including rigging, long boats, pilot house, anchors, etc. Comes with three masts, all square-rigged.'),
(101, 'S700_2466', 'America West Airlines B757-200', 'Planes', 'Official logos and insignias. Working steering system. Rotating jet engines'),
(102, 'S700_2610', 'The USS Constitution Ship', 'Ships', 'All wood with canvas sails. Measures 31 1/2\" Length x 22 3/8\" High x 8 1/4\" Width. Extras include 4 boats on deck, sea sprite on bow, anchors, copper railing, pilot houses, etc.'),
(103, 'S700_2824', '1982 Camaro Z28', 'Classic Cars', 'Features include opening and closing doors. Color: White. \r\nMeasures approximately 9 1/2\" Long.'),
(104, 'S700_2834', 'ATA: B757-300', 'Planes', 'Exact replia with official logos and insignias and retractable wheels'),
(105, 'S700_3167', 'F/A 18 Hornet 1/72', 'Planes', '10\" Wingspan with retractable landing gears.Comes with pilot'),
(106, 'S700_3505', 'The Titanic', 'Ships', 'Completed model measures 19 1/2 inches long, 9 inches high, 3inches wide and is in barn red/black. All wood and metal.'),
(107, 'S700_3962', 'The Queen Mary', 'Ships', 'Exact replica. Wood and Metal. Many extras including rigging, long boats, pilot house, anchors, etc. Comes with three masts, all square-rigged.'),
(108, 'S700_4002', 'American Airlines: MD-11S', 'Planes', 'Polished finish. Exact replia with official logos and insignias and retractable wheels'),
(109, 'S72_1253', 'Boeing X-32A JSF', 'Planes', '10\" Wingspan with retractable landing gears.Comes with pilot'),
(110, 'S72_3212', 'Pont Yacht', 'Ships', 'Measures 38 inches Long x 33 3/4 inches High. Includes a stand.\r\nMany extras including rigging, long boats, pilot house, anchors, etc. Comes with 2 masts, all square-rigged');
